package com.example.fptacademysystem.dto;import java.io.Serializable;public class CourseDTO implements Serializable {    private int courid;    private String cournm;    private int branchid;    private String branchnm;    public int getCourid() {        return courid;    }    public void setCourid(int courid) {        this.courid = courid;    }    public String getCournm() {        return cournm;    }    public void setCournm(String cournm) {        this.cournm = cournm;    }    public int getBranchid() {        return branchid;    }    public void setBranchid(int branchid) {        this.branchid = branchid;    }    public String getBranchnm() {        return branchnm;    }    public void setBranchnm(String branchnm) {        this.branchnm = branchnm;    }}